        return (
            <Form onSubmit={onSubmit}>
                {props => (
                    <form onSubmit={props.handleSubmit}>
                        {
                            Object.entries(entity).map(([key, value]) => {

                                if(!key.toLowerCase().includes('id')){

                                    return (
                                        <Field name="myField">
                                        {props => (
                                          <div>
                                            <TextField
                                              name={key}
                                              value={value}
                                            />
                                          </div>
                                        )}
                                      </Field>
                                    )
                                }
                            })
                        }
                    </form>
                )}
            </Form>
        )

}

export default DeleteUser;
